void DSP_Demo(void)
{
	// FIR 滤波
	myARM_FIR((float *)rawData, pureData);
	
	// 输出 FIR 滤波前后波形，注意滤波器的群延迟效应
	for (uint16_t i = 0; i < FILTER_SIZE - 50; ++i)
		myUART_Transmit_DMA(&UART_Debug, "Data[%d]: %.2f, %.2f\n", i, rawData[i], pureData[i + 50]);
	
	// FFT 幅度谱
	myARM_FFT_Mag((float *)rawData, fftMagData);
	
	// 输出 FFT 幅度谱
	for (uint16_t i = 0; i < FFT_LENGTH; ++i)
		myUART_Transmit_DMA(&UART_Debug, "FFT_Mag[%d]: %.2f\n", i, fftMagData[i]);
}

